import React, { Component} from 'react'
import ReactDOM from 'react-dom'
import AddMore from "./AddMore"
import Dexie from 'dexie'

 
export class App extends Component {



    render() {
        return (
            <div>
                <div> List of Data
                  <AddMore />
                </div>
                <hr></hr>
                <div>
                    <button>Add</button>
                </div>
            </div>
        )
    }
}


ReactDOM.render(<App></App>, document.getElementById("root"))
